import { configureStore } from '@reduxjs/toolkit'
import filterReducer from './slices/filterSlices'
import cardReducer from './slices/CardSlice'
import SnacksCardReducer from './slices/SnacksCardSlice'
import DrinksCardReducer from './slices/DrinksCardSlice'

export default configureStore({
  reducer: {
    filter: filterReducer,
    card: cardReducer,
    Snackscard: SnacksCardReducer,
    DrinksCard: DrinksCardReducer
  },
})
